" \n\t\t<form action=\"#\" method=\"post\" name=\"asl_words\" id=\"asl_words\" onsubmit=\"return check_word()\"> \n<p style=\"margin-top: 0; margin-bottom: 0\"><font face=\"Arial\">&nbsp;</font></p><font face=\"Arial\">\n<img src=\"images/blank.gif\" alt=\"Click on NEW WORD (may take a moment to load)...\" title=\"loading...\" name=\"ASLalphabet\" id=\"ASLalphabet\" border=\"1\" height=\"240\" width=\"240\"> \n<br> \n<input class=\"button\" name=\"refresh\" value=\"new word\" accesskey=\"n\" onclick=\"new_word()\" type=\"button\" style=\"color: #00FFFF; font-family: arial; border: 2px solid #000080; background-color: #000000\">&nbsp;&nbsp;&nbsp; \n<input class=\"button\" value=\"replay\" name=\"repeat\" type=\"button\" accesskey=\"r\" onclick=\"change_speed2()\" style=\"color: #00FFFF; font-family: arial; border: 2px solid #000080; background-color: #000000\">&nbsp;&nbsp; \n<hr color=\"#000080\" noshade=\"noshade\" size=\"1\" width=\"290\"> \n<p style=\"margin-top: 0pt; margin-bottom: 0pt;\">Type your answer here:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; <br>  \n<br> \n \n<input name=\"input\" id=\"answerInput\" size=\"25\" maxlength=\"20\" tabindex=\"1\" class=\"input\" type=\"text\" style=\"background-color: #00FFFF; font-size:14pt; font-family:Arial\">&nbsp;&nbsp; \n<input class=\"button\" name=\"check\" value=\"check\" type=\"submit\" style=\"color: #00FFFF; font-family: arial; border: 2px solid #000080; background-color: #000000\"></p> \n<hr color=\"#800080\" noshade=\"noshade\" size=\"1\" width=\"290\"> \n<p style=\"margin-top: 0; margin-bottom: 0\">  \nMaximum number of letters?&nbsp;&nbsp; \n<input class=\"button\" name=\"letters\" value=\"3\" onclick=\"set_length_lim(3)\" type=\"radio\"> 3&nbsp;&nbsp;\n<input class=\"button\" name=\"letters\" value=\"4\" onclick=\"set_length_lim(4)\" type=\"radio\"> 4&nbsp;&nbsp;\n<input class=\"button\" name=\"letters\" value=\"5\" onclick=\"set_length_lim(5)\" type=\"radio\"> 5&nbsp;&nbsp;\n<input class=\"button\" name=\"letters\" value=\"6\" onclick=\"set_length_lim(6)\" type=\"radio\"> 6&nbsp; \n<input class=\"button\" name=\"letters\" value=\"Any length\" onclick=\"set_length_lim(99)\" type=\"radio\"> \nany </p><p style=\"margin-top: 0; margin-bottom: 0\"> \nSet your speed: &nbsp; \n<input class=\"button\" name=\"speed\" value=\"slow\" accesskey=\"s\" onclick=\"change_speed(0)\" tabindex=\"2\" type=\"radio\"> slow&nbsp;&nbsp; \n<input class=\"button\" name=\"speed\" value=\"medium\" accesskey=\"m\" onclick=\"change_speed(1)\" type=\"radio\" checked=\"\"> medium&nbsp;&nbsp; \n<input class=\"button\" name=\"speed\" value=\"fast\" accesskey=\"f\" onclick=\"change_speed(2)\" type=\"radio\"> fast&nbsp;&nbsp; \n<input class=\"button\" name=\"speed\" value=\"Deaf\" accesskey=\"d\" onclick=\"change_speed(3)\" type=\"radio\"> Deaf</p> \n<p style=\"margin-top: 0; margin-bottom: 0\"> \nFine tune your speed: &nbsp; \n<input class=\"button\" name=\"slower\" value=\"slower\" onclick=\"set_speed(0)\" tabindex=\"2\" type=\"button\" style=\"color: #00FFFF; font-family: arial; border: 2px solid #000080; background-color: #000000\">&nbsp;&nbsp; \n<input class=\"button\" name=\"faster\" value=\"faster\" onclick=\"set_speed(1)\" type=\"button\" style=\"color: #00FFFF; font-family: arial; border: 2px solid #000080; background-color: #000000\"></p><p style=\"margin-top: 0; margin-bottom: 0\"> \n</p><p>Your score <b id=\"scoretxt\">2</b> </p></font></form>"
